    the memo schedule A's for the ASDC Partnership Program reflect gross receipts
    into the program, the amounts that are transferred to the state party reflect
    amounts after fundraising costs. Proceeds are not sent immediately to the state
    party, but on a regular schedule and may not be paid out corresponding to filing
    periods.Please note that our committee participated in a joint fundraising project
